import { Button } from "@mui/material";
import React, { useRef, useLayoutEffect, useState } from "react";
import logo from "./images/logo.jpg";

const Home = () => {
  const submitData = (e) => {
    e.preventDefault();
  };

  const unsafePasswords = () => {};

  const potentialPasswords = () => {};

  const generateSecuredPasswords = () => {};

  return (
    <div
      style={{
        backgroundColor: "black",
        height: 840,
      }}
    >
      <img src={logo} height={"30%"} width={"30%"} />
      <br />
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        Unsafe Passwords
      </Button>
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        Check your Potential Passwords
      </Button>
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        Generate Secured Password
      </Button>
    </div>
  );
};

export default Home;
